import React, { useState } from 'react';
import './About.css';
import LeftArrow from "../assets/icons/short-arrow-left.svg"
import RightArrow from "../assets/icons/short-arrow-right.svg"
import User from '../assets/icons/span-5.svg'
import QuoteIcon from "../assets/icons/quotes.svg"

const ProductSlider = () => {
  // Product data with full details
  const products = [
    {
      id: 1,
      name: "Tech Gadget Pro",
      price: "$299.99",
      image: User,
      description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    },
    {
      id: 2,
      name: "Smart Home Hub",
      price: "$199.50",
      image: User,
      description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    },
    {
      id: 3,
      name: "Wireless Earbuds",
      price: "$149.99",
      image: User,
       description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    },
    {
      id: 4,
      name: "Laptop Companion",
      price: "$449.99",
      image: User,
       description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    },
    {
      id: 5,
      name: "Gaming Mouse",
      price: "$79.99",
      image: User,
       description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    },
    {
      id: 6,
      name: "Portable Charger",
      price: "$59.99",
      image: User,
       description: "Byway's tech courses are top-notch! As someone who's always looking to stay ahead in the rapidly evolving tech world, I appreciate the up-to-date content and engaging multimedia."
    }
  ];

  // State for current slide
  const [currentSlide, setCurrentSlide] = useState(0);

  // Handle next slide
  const handleNextSlide = () => {
    setCurrentSlide((prev) => (prev === 1 ? 0 : 1));
  };

  // Handle previous slide
  const handlePrevSlide = () => {
    setCurrentSlide((prev) => (prev === 0 ? 1 : 0));
  };

  return (
    <>
    <section id="about">
        <section className="wrapper">
            <section class="about">
                <div class="head">
                    <h3>What Our Customer Say About Us</h3>
                    <div class="right">
                        <img class="left-arrow" src={LeftArrow} alt='Left-Arrow' onClick={handlePrevSlide} />
                        <img class="right-arrow" src={RightArrow} alt='Right-Arrow' onClick={handleNextSlide}/>
                    </div>
                </div>
                <div className="product-slider-container">
                    <div className="product-slider">
                        <div 
          className="product-track"
          style={{
            transform: `translateX(-${currentSlide * 50}%)`,
            transition: 'transform 0.5s ease'
          }}
        >
          {/* First Slide */}
          <div className="product-slide">
            {products.slice(0, 3).map((product) => (
              <div key={product.id} className="product-card">
                <img src={QuoteIcon} alt='Quote' />
                <p>{product.description}</p>
                <img src={product.image} alt={product.name} />
                <h3>{product.name}</h3>
                
                <div className="product-footer">
                  <span className="price">{product.price}</span>
                  <button>Add to Cart</button>
                </div>
              </div>
            ))}
          </div>

          {/* Second Slide */}
          <div className="product-slide">
            {products.slice(3, 6).map((product) => (
              <div key={product.id} className="product-card">
                <img src={QuoteIcon} alt='Quote' />
                <p>{product.description}</p>
                <div class="role">
                                        <img src={User} alt='User-Image' />
                                    <div class="name">
                                        <h4>{product.name}</h4>
                                        <small>{product.role}</small>
                                    </div>
                                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      


    </div>
            </section>
        </section>
    </section>


    
    </>
  );
};

export default ProductSlider;
